svg.script:
	
	var moveUp = new Snap.Matrix();
 	moveUp.translate(0, -10);

 	var moveRight = new Snap.Matrix();
 	moveRight.translate(8, 0);

 	var moveLeft = new Snap.Matrix();
 	moveLeft.translate(-2, 0);

	Snap('#lamp1').animate({fill: '#0CEE0E'}, 800, function(){
		Snap('#lamp2').animate({fill: '#0CEE0E'}, 800, function(){
			Snap('#line1').animate({opacity: 1}, 800, function() {
		 	 	Snap('#line2').animate({opacity: 1}, 800, function() {
		 	 		Snap('#line3').animate({opacity: 1}, 800, function() {

					 	Snap('#letter').animate({transform: moveUp}, 1000,function() {
					 		Snap('#line2-1').animate({opacity:1}, 1000,function() {
					 			Snap('#line2-2').animate({opacity:1}, 1000,function() {
									Snap('#bell').animate({transform: moveRight}, 500, function() {
										Snap('#bell').animate({transform: moveLeft}, 500);
									});
								});
							});
					 	});
					});
				});
			});
		});
	});
